import logo from './logo.svg';
import './App.css';
import React from 'react';


class Header extends React.Component {
render() {
    return (
            <div>
              <nav>
                <ul>
                  <li>
                    <a>
                      Home
                    </a>
                  </li>
                  <li>
                    <a>
                     JJ Media Co.
                    </a>
                  </li>
                  <li>
                    <a>
                      Book
                    </a>
                  </li>
                </ul>
              </nav>

            </div>
    );
  }
}

export default Header;
